  return (
    <div>
      <MenuContextProvider>
        <Header openMenu={openMenu} setOpenMenu={setOpenMenu} />
      </MenuContextProvider>
      <div style={{width: '100%', display: 'flex'}}>
        <Sidebar openMenu={openMenu} />
        <div style={{backgroundColor: 'blue', width: '100%'}}>

        </div>
      </div>
    </div>
  );
}

